import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View } from 'react-native';
import {NavigationContainer} from "@react-navigation/native"
import {createStackNagigator} from "react-navigation/stack"

const Stack = createStackNagigator()

function myStack() {
      return (
        <Stack.Navigator>
          <Stack.Screen/>
        </Stack.Navigator>
      )
}

export default function App() {
  return (
    <NavigationContainer>

    </NavigationContainer>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
